def transpose(matrix):
        new_matrix = []
        for i in range(len(matrix[0])):
            matrix1 = []
            for j in range(len(matrix)):
                matrix1.append(matrix[j][i])
            new_matrix.append(matrix1)
        return new_matrix
    
def duplicates(lst, item):
    return [i for i, x in enumerate(lst) if x == item]

def get_list(Dict):
    List = []
    for element in Dict:
        List.append(Dict[element])
    List_trans = transpose(List)
    return List_trans

def get_rank(List):
    List_rank = []
    for i in range(len(List)):
        each_rank = rankdata(List[i], method='min')
        List_rank.append(each_rank)
    return List_rank

def get_rank_2(List_1, List_2, List_rank_1):
    for i in range(len(List_1)):
        dupl = []
        for item in range(1, 10):
            dupl.append(duplicates(List_rank_1[i], item))
        for m in range(len(dupl)):
            if len(dupl[m]) > 1:
                each_list_2 = []
                for element in dupl[m]:
                    each_list_2.append(List_2[i][element])
                each_rank_2 = rankdata(each_list_2, method='min')
#                print(i, item, dupl[m], each_rank_2)
                j = 0
                for element in dupl[m]:
                    List_rank_1[i][element] += each_rank_2[j] - 1
                    j += 1
    return List_rank_1

def get_rank_3(List_1, List_3, List_rank_1):
    for i in range(len(List_1)):
        dupl = []
        for item in range(1, 10):
            dupl.append(duplicates(List_rank_1[i], item))
        for m in range(len(dupl)):
            if len(dupl[m]) > 1:
                each_list_2 = []
                for element in dupl[m]:
                    each_list_2.append(List_3[i][element])
                each_rank_2 = rankdata(each_list_2, method='min')
#                print(i, item, dupl[m], each_rank_2)
                j = 0
                for element in dupl[m]:
                    List_rank_1[i][element] += each_rank_2[j] - 1
                    j += 1
    return List_rank_1
    

def negtive_Fset(Dict):
    for element in Dict:
        newList = []
        for item in Dict[element]:
            newList.append(-item)
        Dict[element] = newList
    return Dict

